import React from 'react';

let Image = function statelessFunctionComponentClass(props) {
    let source = './images/' + props.source;

    let style = {
        width: '200px',
        margin: '10px 5px 0px 5px'
    };

    return (
        <img src={source} style={style} alt="experience"/>
    );
};

export default Image;
